#include "common.h"
using namespace std;

namespace longestDupSubstring {
/*
// TODO: copy problem statement here
 1044. Longest Duplicate Substring
 Hard
 
 64
 
 60
 
 Favorite
 
 Share
 Given a string S, consider all duplicated substrings: (contiguous) substrings of S that occur 2 or more times.  (The occurrences may overlap.)
 
 Return any duplicated substring that has the longest possible length.  (If S does not have a duplicated substring, the answer is "".)
 
 
 
 Example 1:
 
 Input: "banana"
 Output: "ana"
 Example 2:
 
 Input: "abcd"
 Output: ""
 */

class Solution {
public:
    string longestDupSubstring(string S) {
        return longestDupSubstring_rollingHash(S);
    }
    /**
     * rolling hash + binary search
     * https://leetcode.com/problems/longest-duplicate-substring/discuss/316231/C%2B%2B-binary-%2B-rolling-hash
     * https://leetcode.com/problems/longest-duplicate-substring/discuss/290871/Python-Binary-Search
     */
    string longestDupSubstring_rollingHash(string S) {
        int n = S.size();
        const int mod = (1<<31)-1;
        const int b = 29;
        vector<long> power{1};
        power.reserve(n);
        for (int i = 1; i < n; ++i) {
            power.push_back((power.back() * b) %mod);
        }
        
        int l = 1, r = n;
        int ml = 0;
        int st = 0;
        while (l < r) {
            unordered_map<int, int> htoi;
            int m = (l+r+1)/2;
            bool found = false;
            int rh = 0;
            int i = 0;
            for (; i < m-1; ++i) {
                rh = rollingHash(S, power, b, mod, i, m, rh);
            }
            for (; i < n; ++i) {
                rh = rollingHash(S, power, b, mod, i, m, rh);
                auto it = htoi.find(rh);
                if (it != htoi.end()) {
                    if (S.substr(i-m+1, m) == S.substr(it->second-m+1, m)) {
                        ml = m;
                        st = i-m+1;
                    
                        break;
                    }
                } else {
                    htoi.insert(make_pair(rh, i));
                }
            }
            if (i >= n) {
                r = m-1;
            } else {
                l = m;
            }
        }
        return S.substr(st, ml);
    }
    
    int rollingHash(const string& s, const vector<long>& power, int b, int mod, int i, int len, int h) {
        long res = h;
        if (i >= len) {
            res -= ((s[i-len] - 'a' + 1) * power[len-1]) % mod;
            res = (res + mod) % mod;
        }
        res *= b;
        res += s[i] - 'a' + 1;
        return res % mod;
    }
    
    void buildSuffixArray(const string& s, vector<int>& suftab) {
        struct SufArrEntry {
            int s;
            int rank[2];
        };
        
        int n = s.size();
        vector<SufArrEntry> t(n);
        vector<int> pos(n);
        for (int i = 0; i < n; ++i) {
            t[i].s = i;
            t[i].rank[0] = -1;
            t[i].rank[1] = -1;
            pos[i] = s[i] - 'a';
        }

        for (int plen = 1; plen < n; plen <<= 1) {
            for (int i = 0; i < n; ++i) {
                t[i].s = i;
                t[i].rank[0] = pos[i];
                t[i].rank[1] = i+plen < n ? pos[i+plen] : -1;
            }
            sort(t.begin(), t.end(), [](const SufArrEntry& a, const SufArrEntry& b){
                return a.rank[0] == b.rank[0] ? (a.rank[1] < b.rank[1]) : a.rank[0] < b.rank[0];
            });
            
            for (int i = 0; i < n; ++i) {
                pos[t[i].s] = i;
                if (i > 0 && t[i].rank[0] == t[i-1].rank[0] && t[i].rank[1] == t[i-1].rank[1]) {
                    pos[t[i].s] = pos[t[i-1].s];
                }
            }
        }
        
        for (int i = 0; i < n; ++i) {
            suftab[i] = t[i].s;
        }
    }
    void buildLCP_Kasai(const string& s, const vector<int>& suftab, vector<int>& lcp) {
        int n = s.size();
        vector<int> sufinv(n);
        for (int i = 0; i < n; ++i) {
            sufinv[suftab[i]] = i;
        }
        
        int h = 0;
        for (int i = 0; i < n; ++i) {
            if (sufinv[i] > 0) {
                int k = suftab[sufinv[i]-1];
                while (s[i+h] == s[k+h]) {
                    ++h;
                }
                lcp[sufinv[i]] = h;
                if (h > 1) {
                    --h;
                }
            }
        }
    }
    
    string longestDupSubstring_suffixArray(string S) {
        int n = S.size();
        vector<int> suftab(n);
        vector<int> lcp(n);
        
        buildSuffixArray(S, suftab);
        buildLCP_Kasai(S, suftab, lcp);
        
        int maxlcp = 0;
        int maxi = 0;
        for (int i = 0; i < n; ++i) {
            if (maxlcp < lcp[i]) {
                maxlcp = lcp[i];
                maxi = suftab[i];
            }
        }
        return S.substr(maxi, maxlcp);
    }
    
    /**
     * https://leetcode.com/problems/longest-duplicate-substring/discuss/309435/Explanation-of-Suffix-Array-Solution
     https://www.geeksforgeeks.org/ukkonens-suffix-tree-construction-part-1/
     */
    string longestDupSubstring_suffixArray_Naive(string S) {
        auto s = move(S);
        int n = s.size();
        
        vector<int> sufArr;
        for (int i = 0; i < n; ++i) {
            sufArr.push_back(i);
        }
        sort(sufArr.begin(), sufArr.end(), [&s](int a, int b){
            return s.substr(a) < s.substr(b);
        });
        
        int maxi = 0;
        int maxl = 0;
        // compare sufArr[i-1] and sufArr[i]
        for (int i = n-1; i > 0; --i) {
            int a = sufArr[i-1];
            int b = sufArr[i];
            if (n - a < maxl || n - b < maxl) {
                continue;
            }
            while (a < n && b < n && s[a] == s[b]) {
                ++a;
                ++b;
            }
            if (maxl < a - sufArr[i-1]) {
                maxl = a - sufArr[i-1];
                maxi = sufArr[i-1];
            }
        }
        return s.substr(maxi, maxl);
        
    }
    /**
     * DP:
     *  let g(i) = groups of dupliate substrings, one of each group ends at S[i].
     *  then for g(i+1), for each group in g(i), check whether it can be extend to S[i+1].
     *  if so, extend it, and update g(i+1);
     *  otherwise, find possible groups that have length of 1 ending at S[i+1]
     *
     */
    string longestDupSubstring_TLE2(string S) {
        int n = S.size();
        vector<vector<int>> chargs(26);
        
        int maxl = 0;
        int maxi = 0;
        // groups of duplicate substrings, one of each group ends at S[i].
        // key = length of each group
        unordered_map<int, unordered_set<int>> dp;
        for (int i = 0; i < n; ++i) {
            char c = S[i];
            if (dp.empty()) {
                if (chargs[c-'a'].size()) {
                    dp[1].insert(chargs[c-'a'].begin(), chargs[c-'a'].end());
                    if (maxl < 1) {
                        maxi = *(chargs[c-'a'].begin());
                        maxl = 1;
                    }
                }
            } else {
                unordered_map<int, unordered_set<int>> next;
                for (auto& p : dp) {
                    for (auto j : p.second) {
                        if (S[j+1] == c) {
                            next[p.first+1].insert(j+1);
                            if (p.first + 1 > maxl) {
                                maxi = j - p.first + 1;
                                maxl = p.first + 1;
                            }
                        }
                    }
                }
                
                
                // add single characters that are not part of previous matches
                const vector<int>& ni = chargs[c-'a'];
                if (ni.size()) {
                    //
                    next[1].insert(ni.begin(), ni.end());
                }
                dp.swap(next);
            }
            chargs[c-'a'].push_back(i);
        }
        
        return S.substr(maxi, maxl);
        
    }
    /**
     * DP:
     *  let dp[i] = list of all duplicate substring set of length of i.
     *  dp[i+1] = check each group of i and see whther longer duplicate substrings can be
     *  possible or not.
     */
    string longestDupSubstring_TLE(string S) {
        int n = S.size();
        unordered_map<string, unordered_set<int>> dups;
        for (int i = 0; i < n; ++i) {
            dups[S.substr(i,1)].insert(i);
        }
        for (auto it = dups.begin(); it != dups.end();) {
            if (it->second.size() <= 1) {
                it = dups.erase(it);
            } else {
                ++it;
            }
        }
        
        while (dups.size()) {
            unordered_map<string, unordered_set<int>> tmp;
            for (const auto& g : dups) {
                unordered_set<int> ng;
                for (auto i : g.second) {
                    if (i+1 >= n) {
                        continue;
                    }
                    string key(g.first);
                    key.push_back(S[i+1]);
                    tmp[key].insert(i+1);
                }
            }
            for (auto it = tmp.begin(); it != tmp.end();) {
                if (it->second.size() <= 1) {
                    it = tmp.erase(it);
                } else {
                    ++it;
                }
            }
            if (tmp.empty()) {
                break;
            }
            dups.swap(tmp);
        }
        if (dups.size()) {
            return dups.begin()->first;
        }
        return "";
    }

private:
};

}

